Elbow are an alternative rock band based in England. The band formed in the English town of Bury in 1990, and currently comprises lead vocalist, guitarist and lyricist Guy Garvey, guitarist and back up vocalist Mark Potter, keyboardist and back up vocalist Craig Potter, bassist Pete Turner and drummer Richard Jupp. Over the band&amp;#039;s 18 year career they have released four studio albums, four EPs and ten top fifty singles in the UK.





